import React from 'react'

export default function Navi() {
    const naviList = ["Hakkımızda" ,"Hizmetler", "İletişim", "Fiyat Listesi"].map((list)=> 
    <li className='float-left list-none pr-4 text-white'> {list}</li>
    )
  return (
    <div className='bg-slate-600 h-28'>
    <div className='bg-slate-700 w-40 h-28 -mt-6' >
        <h1 className='text-white font-bold text-3xl float-left pl-12 pt-4'>LOGO</h1>
    </div>
    <ul className='float-right'>
      {naviList}
    </ul>
    </div>
  )
}
